import React from 'react'
import ModelStore from "../../stores/ModelStore";
import * as MyActions from "../../actions/MyActions";
import { dict } from '../../Dict';
import Header from "../header/header.jsx";
import MeetingCard from "../meetings/card.jsx";

export default class EventShow extends React.Component {

  constructor(props) {
    super(props);
    //this.submit = this.submit.bind(this);
    this.getInstance = this.getInstance.bind(this);
    this.handleChange = this.handleChange.bind(this);

    this.state = {
      token: window.localStorage.getItem('token'),
      title: null,
      id: null,
      event_type: null,
      info: null,
      meetings: [],
    }

  }


  componentWillMount() {
    ModelStore.on("got_instance", this.getInstance);
  }

  componentWillUnmount() {
    ModelStore.removeListener("got_instance", this.getInstance);
  }

  componentDidMount() {
    MyActions.getInstance('events', this.props.match.params.id, this.state.token);
  }



  handleChange(obj) {

  }

  getInstance() {
    var klass = ModelStore.getKlass()
    var model = ModelStore.getIntance()
    if (klass === 'Event') {
      this.setState({
        title: model.title,
        id: model.id,
        event_type: model.event_type,
        info: model.info,
        meetings: model.meetings
      })
    }
  }


  render() {

    return (
      <body className="antialiased">
        <div className="wrapper">
          <Header />
          <div className="page-wrapper">
            <div className="container-xl">
              <div className="page-header d-print-none">
                <div className="row align-items-center"></div>
                <div className="col">
                  <div className="page-pretitle">Overview</div>
                  <h2 className="page-title">Condensed dark layout</h2>
                </div>
              </div>
            </div>
            <div className="page-body">
              <div className="container-xl">
                <div className="row  row-cards">

                  <MeetingCard meetings={this.state.meetings} />

                  <div class="col-4">
                    <div class="card">
                      <div class="card-header">
                        <h3 class="card-title"></h3>
                      </div>
                      <div class="card-body" style={{ minHeight: '200px' }}>
                        <p></p>
                      </div>
                      <div class="card-footer">
                        {this.state.event_type}
                      </div>
                    </div>
                  </div>

                  <div class="col-lg-4">
                    <div class="card">
                      <div class="card-body">
                        <div class="d-flex align-items-center mb-3">
                          <div class="me-3">

                            <svg xmlns="http://www.w3.org/2000/svg" class="icon icon-md" width="24" height="24" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round"><path stroke="none" d="M0 0h24v24H0z" fill="none"></path><line x1="7" y1="20" x2="17" y2="20"></line><path d="M6 6l6 -1l6 1"></path><line x1="12" y1="3" x2="12" y2="20"></line><path d="M9 12l-3 -6l-3 6a3 3 0 0 0 6 0"></path><path d="M21 12l-3 -6l-3 6a3 3 0 0 0 6 0"></path></svg>
                          </div>
                          <div>
                            <small class="text-muted">tabler/tabler is licensed under the</small>
                            <h3 class="lh-1">{this.state.title}</h3>
                          </div>
                        </div>
                        <h4>Info:</h4>
                        <div class="text-muted mb-3">
                        {this.state.info}
                        </div>

                      </div>
                      <div class="card-footer">
                        This is not legal advice.
                        <a href="#" target="_blank">Learn more about repository licenses.</a>
                      </div>
                    </div>
                  </div>

                </div>
              </div>
            </div>
          </div>
        </div>
      </body>
    )
  }
}
